import React, { useEffect, useState } from 'react';
import axios from 'axios';

const UserDashboard = () => {
  const [weekData, setWeekData] = useState([]);
  const [hoursData, setHoursData] = useState({});
  const [totalHours, setTotalHours] = useState(0);

  useEffect(() => {
    // Fetch data from backend
    axios.get('/api/user-data')
      .then(response => {
        setWeekData(response.data.thisWeek);
        setHoursData(response.data.hours);
        setTotalHours(response.data.totalHours);
      })
      .catch(error => console.error("Error fetching data:", error));
  }, []);

  // Utility function to check if a day is in the thisWeek data
  const isDayChecked = (day) => weekData.includes(day);

  // Render the component
  return (
    <div className="dashboard">
      <header>
        <h1>Welcome Jane</h1>
        <div className="icons">
          <i className="calendar-icon">üìÖ</i>
          <i className="notification-icon">üîî</i>
        </div>
      </header>

      <section className="this-week">
        <h2>This Week</h2>
        <div className="week-days">
          {['Sun', 'Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat'].map((day, index) => (
            <div key={index} className={`day ${isDayChecked(day) ? 'checked' : ''}`}>
              <span>{day}</span>
              {isDayChecked(day) && <span className="check-mark">‚úîÔ∏è</span>}
            </div>
          ))}
        </div>
        <p>{weekData.length}/7 Days</p>
      </section>

      <section className="hours">
        <h2>Hours</h2>
        <div className="hours-bars">
          {['Sun', 'Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat'].map((day, index) => (
            <div key={index} className="hour-bar">
              <span>{hoursData[day] || '0'}hr</span>
              <div className="bar" style={{ height: `${(hoursData[day] || 0) * 10}%` }}></div>
            </div>
          ))}
        </div>
        <p>{totalHours} hours</p>
      </section>
    </div>
  );
};

export default UserDashboard;
